import { useEffect } from "react"
import { Route, Routes, useNavigate } from "react-router-dom"
function FrontendRoutes() {
    const isLoging = true
    const navigate = useNavigate()
    useEffect(() => {
        if (!isLoging) {
            console.log("akaka");
            navigate('/login')
        } else {
            navigate('/dashbord')
        }
    },[])
    return <>
        <Routes>
            <Route path="/" element="hello loginUi" />
            <Route path="/dashbord" element="hello dashbord" />
            <Route path="/login" element="hello login Form" />
        </Routes>

    </>
}
export default FrontendRoutes
